INSERT INTO `preguntacueclima` VALUES (1,'1. Estoy satisfecho con mi trayectoria/carrera dentro de la Empresa.',1,'Sentido de pertenencia'),(2,'2. Me siento orgulloso de pertenecer a esta Empresa.',2,'Sentido de pertenencia'),(3,'3. Me siento integrado y tomado en cuenta dentro de la Empresa.',3,'Sentido de pertenencia'),(4,'4. Conozco la visión, misión y políticas de la Empresa.',4,'Sentido de pertenencia'),(5,'1. Cuento con las habilidades necesarias para hacer que mi trabajo muestre los resultados que la Empresa espera de mí.',5,'Capacitación'),(6,'2. He contado desde mi ingreso con la capacitación necesaria para hacer que mi trabajo dé los resultados que la Empresa espera de mí.',6,'Capacitación'),(7,'3. Cuando entré a la Empresa, recibí en tiempo y forma adecuada la inducción por parte de la Empresa.',7,'Capacitación'),(8,'4. Conozco y estoy enterado de los servicios que se ofrecen en SERCOMEX.',8,'Capacitación'),(9,'1. Cuento con buenos  amigos dentro de la Empresa.',9,'Relaciones internas'),(10,'2. Convivo con mis Compañeros fuera de la Empresa.',10,'Relaciones internas'),(11,'3. Me llevo bien con mis compañeros de área.',11,'Relaciones internas'),(12,'4. Existe un ambiente de trabajo armonioso y libre de enfrentamientos y conflictos entre áreas.',12,'Relaciones internas'),(13,'1. Considero justo el salario y prestaciones que recibo.',13,'Compensación'),(14,'2. Mi percepción económica es justa respecto a lo que mi trabajo aporta a la Empresa.',14,'Compensación'),(15,'3. La compensación económica que recibo satisface mis necesidades de acuerdo al estilo de vida que llevo.',15,'Compensación'),(16,'4. Me parece justa la manera en cómo están balanceadas las compensaciones en la empresa.',16,'Compensación'),(17,'1. Como Colaborador de esta Empresa siento que me valoran.',17,'Compromiso'),(18,'2. Tengo claro lo que se espera de mí y del resultado de mi trabajo.',18,'Compromiso'),(19,'3. Creo que todos nos enfocamos al resultado de la misma forma para alcanzar los objetivos de la Empresa.',19,'Compromiso'),(20,'4. Conozco los objetivos principales de mi área y su relación con los objetivos principales de la Empresa.',20,'Compromiso'),(21,'5. Sé el valor que mi trabajo aporta a los objetivos principales de la Empresa, no solo de mi área.',21,'Compromiso'),(22,'6. Siento míos y parte de mi responsabilidad los objetivos generales de la Empresa.',22,'Compromiso'),(23,'1. Recomendaría a SERCOMEX como una Empresa en donde puedes desarrollar al máximo tu potencial personal y profesional. ',23,'Identificación con la Empresa'),(24,'2. Practico los valores de la empresa y adopto la misión y visión de SERCOMEX como propios.',24,'Identificación con la Empresa'),(25,'3. Me gustaría trabajar en SERCOMEX por muchos años más.',25,'Identificación con la Empresa'),(26,'3.1- Si tu respuesta es negativa, por favor déjanos saber los motivos:',0,'Identificación con la Empresa'),(27,'4. Creo que gran parte de mis compañeros se sienten satisfechos de trabajar en SERCOMEX.',26,'Identificación con la Empresa'),(28,'1. Cuando recibo instrucciones para desempeñar mis funciones, éstas son claras, precisas, concisas y oportunas.',27,'Trabajo en sí'),(29,'2. Considero que las cargas de trabajo de las personas que integramos el área están bien balanceadas.',28,'Trabajo en sí'),(30,'3. Mi horario de trabajo es satisfactorio.',29,'Trabajo en sí'),(31,'4. Encuentro en SERCOMEX el campo fértil para lograr mi desarrollo humano y profesional.',30,'Trabajo en sí'),(32,'5. Obtengo el  reconocimiento adecuado a los logros que realizo.',31,'Trabajo en sí'),(33,'1. Es fácil y eficiente ponernos de acuerdo cuando tenemos que realizar alguna meta en equipo.',32,'Trabajo en equipo'),(34,'2. Existe una cooperación estrecha entre los participantes de los procesos de operación  para incrementar la eficiencia de la Empresa.',33,'Trabajo en equipo'),(35,'3. Se establece claramente el objetivo del equipo y la agenda para lograrlo en las reuniones que participó.',34,'Trabajo en equipo'),(36,'4. Mi Jefe sabe cómo coordinar y motivar al equipo de trabajo del cual  formo parte.',35,'Trabajo en equipo'),(37,'1. Sé con exactitud quién es mi Jefe.',36,'Liderazgo (relación con jefe)'),(38,'2. Mi Jefe da reconocimiento al trabajo bien realizado.',37,'Liderazgo (relación con jefe)'),(39,'3. Mi Jefe favorece al máximo mi compromiso con la Empresa.',38,'Liderazgo (relación con jefe)'),(40,'4. Soy tratado con respeto y cordialidad por mi Jefe.',39,'Liderazgo (relación con jefe)'),(41,'1. Mis sugerencias e ideas son tomadas en cuenta para mejorar los procesos y métodos de trabajo en los que participo.',40,'Innovación y tecnología'),(42,'2. Me adapto al cambio con facilidad y estoy dispuesto al logro más eficaz de objetivos. ',41,'Innovación y tecnología'),(43,'3. Contamos con las herramientas tecnológicas adecuadas para la realización y el logro de nuestras metas en forma óptima.',42,'Innovación y tecnología'),(44,'1. Confío en la capacidad de la Dirección para guiar y tomar las decisiones necesarias a fin de asegurar el futuro exitoso de la Empresa.',43,'Desempeño de la Dirección'),(45,'2. Cuando la Dirección dice algo, se pude estar seguro de que es verdad.',44,'Desempeño de la Dirección'),(46,'3. Mi Jefe me transmite la  misión, visión y valores de SERCOMEX en forma verbal y en su conducta habitual.',45,'Desempeño de la Dirección'),(47,'1. Considero que la Calidad es un valor importante y presente en mí actuar y mis resultados.',46,'Calidad y productividad'),(48,'2. La reducción de costos es  importante  en mi trabajo diario.',47,'Calidad y productividad'),(49,'3. Considero que lo que hago actualmente está bien hecho y que no hay otra forma de hacerlo.',48,'Calidad y productividad'),(50,'4. Existen procesos de mejora continua y de verificación de la calidad de mi trabajo y de mis colaboradores.',49,'Calidad y productividad'),(51,'1. Sé con exactitud qué servicios  suministramos a los clientes.',50,'Enfoque al cliente'),(52,'2. Conozco y entiendo correctamente lo que Valoran los clientes de SERCOMEX',51,'Enfoque al cliente'),(53,'2.1 Explicar',0,'Enfoque al cliente'),(54,'3. Tengo una cultura de cumplimiento a los compromisos contraídos con usuarios y clientes.',52,'Enfoque al cliente'),(55,'4. Normalmente tengo la mejor disposición de atender a nuestros clientes siempre que me solicitan atención o me buscan.',53,'Enfoque al cliente'),(56,'1. Creo que se tomarán medidas basadas en los resultados de esta encuesta.',54,'Estrategias de la Compañía'),(57,'2. Tengo idea de cuáles son los planes de crecimiento de la Empresa a un año.',55,'Estrategias de la Compañía'),(58,'3. Contamos con un proceso adecuado para la definición de la planeación estratégica de mi área.',56,'Estrategias de la Compañía'),(59,'4. En general, estoy de acuerdo con las estrategias, metas y políticas de SERCOMEX.',57,'Estrategias de la Compañía'),(60,'Años de servicio en la Empresa',60,NULL),(61,'Edad',61,NULL),(62,'Comentarios abiertos',62,NULL);
