e permiten asistir a capacitaciones relacionadas con mi trabajo',26,26),(27,'27.- Recibo capacitación útil para hacer mi trabajo',27,27),(28,'28.- Mi jefe tiene en cuenta mis puntos de vista y opiniones',28,28),(29,'29.- Mi jefe ayuda a solucionar los problemas que se presentan en el trabajo',29,29),(30,'30.- Puedo confiar en mis compañeros de trabajo',30,30),(31,'31.- Cuando tenemos que realizar trabajo de equipo los compañeros colaboran',31,31),(32,'32.- Mis compañeros de trabajo me ayudan cuando tengo dificultades',32,32),(33,'33.- En mi trabajo puedo expresarme libremente sin interrupciones',33,33),(34,'34.- Recibo críticas constantes a mi persona y/o trabajo',34,34),(35,'35.- Recibo burlas, calumnias, difamaciones, humillaciones o ridiculizaciones',35,35),(36,'36.- Se ignora mi presencia o se me excluye de las reuniones de trabajo y en la toma de decisiones',36,36),(37,'37.- Se manipulan las situaciones de trabajo para hacerme parecer un mal trabajador',37,37),(38,'38.- Se ignoran mis éxitos laborales y se atribuyen a otros trabajadores',38,38),(39,'39.- Me bloquean o impiden las oportunidades que tengo para obtener ascenso o mejora en mi trabajo',39,39),(40,'40.- He presenciado actos de violencia en mi centro de trabajo',40,40),(41,'41.- Atiendo clientes o usuarios muy enojados',41,42),(42,'42.- Mi trabajo me exige atender personas muy necesitadas de ayuda o enfermas',42,43),(43,'43.- Para hacer mi trabajo debo demostrar sentimientos distintos a los míos',43,44),(44,'44.- Comunican tarde los asuntos de trabajo',44,46),(45,'45.- Dificultan el logro de los resultados del trabajo',45,47),(46,'46.- Ignoran las sugerencias para mejorar su trabajo',46,48),(47,'En mi trabajo debo brindar servicio a clientes o usuarios:',47,41),(48,'Soy jefe de otros trabajadores:',48,45);
