INSERT INTO `preguntacuetres` VALUES (1,'1.- El espacio donde trabajo me permite realizar mis actividades de manera segura e higiénica',1,1),(2,'2.- Mi trabajo me exige hacer mucho esfuerzo físico',2,2),(3,'3.- Me preocupa sufrir un accidente en mi trabajo',3,3),(4,'4.- Considero que en mi trabajo se aplican las normas de seguridad y salud en el trabajo',4,4),(5,'5.- Considero que las actividades que realizo son peligrosas',5,5),(6,'6.- Por la cantidad de trabajo que tengo debo quedarme tiempo adicional a mi turno',6,6),(7,'7.- Por la cantidad de trabajo que tengo debo trabajar sin parar',7,7),(8,'8.- Considero que es necesario mantener un ritmo de trabajo acelerado',8,8),(9,'9.- Mi trabajo exige que esté muy concentrado',9,9),(10,'10.- Mi trabajo requiere que memorice mucha información',10,10),(11,'11.- En mi trabajo tengo que tomar decisiones difíciles muy rápido',11,11),(12,'12.- Mi trabajo exige que atienda varios asuntos al mismo tiempo',12,12),(13,'13.- En mi trabajo soy responsable de cosas de mucho valor',13,13),(14,'14.- Respondo ante mi jefe por los resultados de toda mi área de trabajo',14,14),(15,'15.- En el trabajo me dan órdenes contradictorias',15,15),(16,'16.- Considero que en mi trabajo me piden hacer cosas innecesarias',16,16),(17,'17.- Trabajo horas extras más de tres veces a la semana',17,17),(18,'18.- Mi trabajo me exige laborar en días de descanso, festivos o fines de semana',18,18),(19,'19.- Considero que el tiempo en el trabajo es mucho y perjudica mis actividades familiares o personales',19,19),(20,'20.- Debo atender asuntos de trabajo cuando estoy en casa',20,20),(21,'21.- Pienso en las actividades familiares o personales cuando estoy en mi trabajo',21,21),(22,'22.- Pienso que mis responsabilidades familiares afectan mi trabajo',22,22),(23,'23.- Mi trabajo permite que desarrolle nuevas habilidades',23,23),(24,'24.- En mi trabajo puedo aspirar a un mejor puesto',24,24),(25,'25.- Durante mi jornada de trabajo puedo tomar pausas cuando las necesito',25,25),(26,'26.- Puedo decidir cuánto trabajo realizo durante la jornada laboral',26,26),(27,'27.- Puedo decidir la velocidad a la que realizo mis actividades en mi trabajo',27,27),(28,'28.- Puedo cambiar el orden de las actividades que realizo en mi trabajo',28,28),(29,'29.- Los cambios que se presentan en mi trabajo dificultan mi labor',29,29),(30,'30.- Cuando se presentan cambios en mi trabajo se tienen en cuenta mis ideas o aportaciones',30,30),(31,'31.- Me informan con claridad cuáles son mis funciones',31,31),(32,'32.- Me explican claramente los resultados que debo obtener en mi trabajo',32,32),(33,'33.- Me explican claramente los objetivos de mi trabajo',33,33),(34,'34.- Me informan con quién puedo resolver problemas o asuntos de trabajo',34,34),(35,'35.- Me permiten asistir a capacitaciones relacionadas con mi trabajo',35,35),(36,'36.- Recibo capacitación útil para hacer mi trabajo',36,36),(37,'37.- Mi jefe ayuda a organizar mejor el trabajo',37,37),(38,'38.- Mi jefe tiene en cuenta mis puntos de vista y opiniones',38,38),(39,'39.- Mi jefe me comunica a tiempo la información relacionada con el trabajo',39,39),(40,'40.- La orientación que me da mi jefe me ayuda a realizar mejor mi trabajo',40,40),(41,'41.- Mi jefe ayuda a solucionar los problemas que se presentan en el trabajo',41,41),(42,'42.- Puedo confiar en mis compañeros de trabajo',42,42),(43,'43.- Entre compañeros solucionamos los problemas de trabajo de forma respetuosa',43,43),(44,'44.- En mi trabajo me hacen sentir parte del grupo',44,44),(45,'45.- Cuando tenemos que realizar trabajo de equipo los compañeros colaboran',45,45),(46,'46.- Mis compañeros de trabajo me ayudan cuando tengo dificultades',46,46),(47,'47.- Me informan sobre lo que hago bien en mi trabajo',47,47),(48,'48.- La forma como evalúan mi trabajo en mi centro de trabajo me ayuda a mejorar mi desempeño',48,48),(49,'49.- En mi centro de trabajo me pagan a tiempo mi salario',49,49),(50,'50.- El pago que recibo es el que merezco por el trabajo que realizo',50,50),(51,'51.- Si obtengo los resultados esperados en mi trabajo me recompensan o reconocen',51,51),(52,'52.- Las personas que hacen bien el trabajo pueden crecer laboralmente',52,52),(53,'53.- Considero que mi trabajo es estable',53,53),(54,'54.- En mi trabajo existe continua rotación de personal',54,54),(55,'55.- Siento orgullo de laborar en este centro de trabajo',55,55),(56,'56.- Me siento comprometido con mi trabajo',56,56),(57,'57.- En mi trabajo puedo expresarme libremente sin interrupciones',57,57),(58,'58.- Recibo críticas constantes a mi persona y/o trabajo',58,58),(59,'59.- Recibo burlas, calumnias, difamaciones, humillaciones o ridiculizaciones',59,59),(60,'60.- Se ignora mi presencia o se me excluye de las reuniones de trabajo y en la toma de decisiones',60,60),(61,'61.- Se manipulan las situaciones de trabajo para hacerme parecer un mal trabajador',61,61),(62,'62.- Se ignoran mis éxitos laborales y se atribuyen a otros trabajadores',62,62),(63,'63.- Me bloquean o impiden las oportunidades que tengo para obtener ascenso o mejora en mi trabajo',63,63),(64,'64.- He presenciado actos de violencia en mi centro de trabajo',64,64),(65,'65.- Atiendo clientes o usuarios muy enojados',65,66),(66,'66.- Mi trabajo me exige atender personas muy necesitadas de ayuda o enfermas',66,67),(67,'67.- Para hacer mi trabajo debo demostrar sentimientos distintos a los míos',67,68),(68,'68.- Mi trabajo me exige atender situaciones de violencia',68,69),(69,'69.- Comunican tarde los asuntos de trabajo',69,71),(70,'70.- Dificultan el logro de los resultados del trabajo',70,72),(71,'71.- Cooperan poco cuando se necesita',71,73),(72,'72.- Ignoran las sugerencias para mejorar su trabajo',72,74),(73,'En mi trabajo debo brindar servicio a clientes o usuarios:',73,65),(74,'Soy jefe de otros trabajadores:',74,70);
